import React from 'react';
import BlogCard from './blogcard';

const BlogsCards = props => {
    return (
        <>
            <div className="row">
                <div className="col-4">
                    {
                        !!props.bloginfo &&
                        props.bloginfo.map((elem, i) => {
                            return (
                                <BlogCard
                                    id={elem.id}
                                    blogimg1={elem.blogimg1}
                                    title={elem.title}
                                    bodybase={elem.bodybase}
                                />
                            )
                        })

                    }

                </div>
            </div>
        </>
    )
}

export default BlogsCards;
